import { Link } from 'react-router-dom'

const quizzes = [
  { id: 1, title: 'test 1', slug: 'slug-1', category: 'react' },
  { id: 2, title: 'test 2', slug: 'slug-2', category: 'sanity' },
]

function Quizzes() {
  return (
    <div>
      <h1 className="text-3xl font-bold text-white">Velkommet til HIOF quiz</h1>
      <ul className="mt-4 ">
        {quizzes.map((quiz) => (
          <li key={quiz.id}>
            <Link to={`/quiz/${quiz.slug}`}>{quiz.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default Quizzes
